text:
founded in new york, in 1985, the guerrilla girls is an american feminist collective of over 55 anonymous women artists with a mission to fight sexism and racism in the art world. they hide their identities behind gorilla masks and each member takes the name of a dead woman artist as a pseudonym. alongside their hard stance on gender rights, facts and raw data to make their point, their art is hilarious. log on to www.onepagespotlight.com to know what the guerrilla girls are up to next!
.
