pre_proc_tweet:
"you are so strong"//
//
sometimes it is hard.  people think i have my shit together because i am always smiling, and i guess i do to a ceain extent, we all do. but it is a continous day to day battle with myself against sadly, members of my family who have never wanted me to achieve in life since the day i was born, and whom have worked hard to fill my mind with self doubt and a lack of confidence. it worked for a significan not poion of my life, but alot of my teenage years have been spent breaking down these mental barriers of self doubt whilst at the same time mourning the death of the only person who ever held my hand, who reassured me of my capabilities and potential in life and made me feel good about myself. i try not to rely on people for happiness anymore. i rely on allah first and foremost and then myself. it is difficult but i am getting there. these last few years have made me realise 1) my true capabilities in life: mentally, emotionally and physically and 2) it is not selfish to put yourself first. //
//
2018 so far has been such a blessed year and i hope it continues to be this blessed. alhamdulillah. all praise is due to allah.//
//
